--
-- Table structure for table `lend`
--

DROP TABLE IF EXISTS `lend`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `lend` (
  `LEND_ID` char(4) COLLATE utf8mb4_unicode_ci NOT NULL,
  `STT` int NOT NULL,
  `DEVICE_CODE` varchar(45) COLLATE utf8mb4_unicode_ci NOT NULL,
  `RENT_TIME` datetime DEFAULT NULL,
  `PAY_TIME` datetime DEFAULT NULL,
  `DESCRIBE` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `QUANTITY` int DEFAULT NULL,
  `STATUS` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `INSURANCE_START` datetime DEFAULT NULL,
  `INSURANCE_END` datetime DEFAULT NULL,
  `WARRANTY` char(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `CONDITION` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `ID` char(4) COLLATE utf8mb4_unicode_ci NOT NULL,
  `PRODUCT_ID` char(10) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`LEND_ID`),
  KEY `ID` (`ID`),
  KEY `PRODUCT_ID` (`PRODUCT_ID`),
